import React, { Component } from 'react'
import { ListGroup,ListGroupItem } from 'reactstrap'

export default class Category extends Component {
  render() {
    return (
        <div class="col-6">
        <h3>Category List</h3>
            <ListGroup>
                <ListGroupItem><button class="btn btn-primary">giyim</button></ListGroupItem>
                <ListGroupItem><button class="btn btn-primary">mobilya</button></ListGroupItem>
                <ListGroupItem><button class="btn btn-primary">Teknoloji</button></ListGroupItem>
            </ListGroup>
        </div>
    )
  }
}
